import '../../styles/Main.css';
import house from '../../img/my_house.webp';

function Primise() {
	return (
	    <a href="/" className="primise">
            <img src={house}/>
            <div>Лучшая хата, что бы ебать Андрея</div>
            <div>2000 BYN</div>
        </a>
  	);
}

export default Primise;
